def countValidSubstrings(s: str, k: int) -> int:
    def atMostKChars(char: str) -> int:
        count = 0
        char_count = 0
        left = 0
        for right in range(len(s)):
            if s[right] == char:
                char_count += 1
            while char_count > k:
                if s[left] == char:
                    char_count -= 1
                left += 1
            count += right - left + 1
        return count

    return atMostKChars('0') + atMostKChars('1')

